import Input from "../UI/Input";
import "./MealItemForm.css";

const ItemForm = (props) => {
  return (
    <form className="form">
      <Input label="amount" input={{
        id:"amount",
        type:"number",
        min:"1",
        max:'5',
        
      }}/>
      <button>+ ADD</button>
    </form>
  );
};

export default ItemForm;
